const Departments = ({
  setSlected,
  selected,
  allowedDepartments,
  initialViewBox,
}: {
  setSlected: (id: any) => void;
  selected: any[];
  allowedDepartments: any[];
  initialViewBox: string;
}) => {
  const [hoveredDep, setHoveredDep] = useState<string | null>(null);
  const [viewBox, setViewBox] = useState(initialViewBox);
  useEffect(() => {
    setViewBox(initialViewBox);
  }, [initialViewBox]);
  const [mousePos, setMousePos] = useState<{ x: number; y: number }>({ x: 0, y: 0 });
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      stroke="#fff"
      preserveAspectRatio="xMidYMid meet"
      viewBox={'viewBox'}
      strokeLinecap="round"
      strokeLinejoin="round"
      strokeWidth="0.5"
      version="1.2"
    >
      {departments.map(({ id, d }) => {
        const isAllowed = allowedDepartments.includes(id);
        const isSelected = selected.includes(id);
        return (
          <path
            key={id}
            id={`departement-${id}`}
            d={d}
            fill="currentColor"
            onMouseOver={(e) => {
              setHoveredDep(id);
            }}
            onMouseOut={() => {
              setHoveredDep(null);
            }}
            onMouseMove={(e) => {
              const rect = (e.currentTarget as SVGPathElement).ownerSVGElement!.getBoundingClientRect();
              setMousePos({
                x: e.clientX - rect.left,
                y: e.clientY - rect.top,
              });
            }}
            className={`cursor-pointer transition-all transform duration-200 ease-out
              ${!isAllowed ? "text-gray-200" : "text-gray-400"} 
              ${(hoveredDep===id && !isSelected)&&'text-gray-700 '}
              ${isSelected ? "text-blue-500" : ""}`}
            onClick={() =>
              setSlected((prev: any[]) =>
                prev.includes(id)
                  ? prev.filter((el) => el !== id)
                  : [...prev, id]
              )
            }
          />
        );
      })}

      {/* Floating label near cursor */}
      <g id="label_points">
          {hoveredDep && (() => {
            const info = departmentsNames.find((dep) => dep.id === hoveredDep);
            if (!info) return null;

            const padding = 6;
            const fontSize = 14;
            const textWidth = info.name.length * (fontSize * 0.6); // rough estimate
            const textHeight = fontSize + padding;

            const x = mousePos.x + 10;
            const y = mousePos.y - 10;

            return (
              <>
                {/* Shadow */}
                <rect
                  x={x - padding / 2 + 2}
                  y={y - textHeight + 2}
                  width={textWidth + padding}
                  height={textHeight}
                  fill="rgba(0,0,0,0.2)"
                  rx={4}
                  ry={4}
                />
                {/* Background */}
                <rect
                  x={x - padding / 2}
                  y={y - textHeight}
                  width={textWidth + padding}
                  height={textHeight}
                  fill="#fff"
                  rx={4}
                  ry={4}
                />
                {/* Text */}
                <text
                  x={x}
                  y={y - textHeight / 2}
                  textAnchor="start"
                  alignmentBaseline="middle"
                  fontSize={fontSize}
                  fill="currentColor"
                  className="pointer-events-none font-bold text-black select-none transition-all duration-150 ease-in-out"
                >
                  {info.name}
                </text>
              </>
            );
          })()}
        </g>
    </svg>
  );
};

export default Departments;